const baseUrl = 'http://harsha90.pythonanywhere.com/api';

const Api = {
    userLogin: `${baseUrl}/auth/login/`,
    contactUs: `${baseUrl}/contact/`,
    userDetail: `${baseUrl}/auth/user/`,
}

export default Api;
